import "./Page3pop.css";

function Page3pop() {
  return (
    <div className="Apppop">
      <button> popUp </button>
      <div>
        <div className="main">
          <div className="popUp">
            <div className="popUp-header"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Page3pop;
